import React from 'react';
import ManagerProducts from './container/ManagerProducts/index';

const routes = [
  {
    title: "Home",
    path: "/",
    exact: true,
    main: () => <ManagerProducts/>,
  },
  {
    title: "",
    path: "/bubblegum",
    main: () => <h2>Bubblegum</h2>,
  },
  {
    title: "shoelaces",
    path: "/shoelaces",
    main: () => <h2>Shoelaces</h2>,
  },
];
export default routes;
